import React,{ Component} from 'react';

class List extends Component{
    constructor(props){
      super(props);
    }

    render(){

          <div className="List">
            {this.props.list.map((l)=> {
                <li>{l}<input type="checkbox"/></li>
            })}
          </div>

    }

}

export default List;
